import './onlinefriends.css'

function Onlinefriends({u}) {
    return (
        <li className="rightbarFriend">
        <div className="rightbarFriendImgContainer">
            <img src="/assets/person/3.jpeg" alt="online friend" className="rightbarFriendImg" />
            <span className="rightbarOnlineBadge"></span>
        </div>
        <span className="rightbarFriendName">Jake Carter</span>
    </li>
    )
}

export default Onlinefriends
